import React, { useContext } from "react";
import Form from "react-bootstrap/Form";
import { Context } from "../Context/context";

const Help = () => {
  const ctx = useContext(Context);

  const handlerValue = (e) => {
    switch (e.target.value) {
      case "1":
        ctx.searchUserSelect(0, 150);
        break;
      case "2":
        ctx.searchUserSelect(150, 300);
        break;
      case "3":
        ctx.searchUserSelect(300, 450);
        break;
      case "4":
        ctx.searchUserSelect(450, 10000);
        break;
    }
  };
  const prueba = (e) => {
    ctx.searchUserCheck(e.target.checked);
    console.log(e.target.checked);
  };

  ctx.searchUserCheck(e.target.checked);
  console.log(e.target.checked);

  return (
    <>
      <Form>
        <div className="mt-3 ms-3">
          <Form.Check
            className="fw-bold"
            type="checkbox"
            label="Bigger Amount Donate"
          />
        </div>
      </Form>
      <Form>
        <div className="mt-3 ms-3">
          <Form.Check
            className="fw-bold"
            type="checkbox"
            label="Minor Amount Donate"
            onChange={prueba}
          />
        </div>
      </Form>
      <Form>
        <div className="mt-3 ms-3">
          <Form.Check
            className="fw-bold"
            type="checkbox"
            label="default checkbox"
          />
        </div>
      </Form>
      <Form.Check
        type="switch"
        id="custom-switch"
        label="Check this switch"
        className="mt-3 ms-3"
      />
      <Form.Select
        className="ms-1 mt-2"
        aria-label="Default select example"
        onChange={handlerValue}
      >
        <option>According to rank</option>
        <option className="fw-bold" value="1">
          0 - 150
        </option>
        <option className="fw-bold" value="2">
          150 - 300
        </option>
        <option className="fw-bold" value="3">
          300 - 450
        </option>
        <option className="fw-bold" value="4">
          Bigger than 450
        </option>
      </Form.Select>
    </>
  );
};

export default Help;
